INSERT INTO `sa_bankuai_article` VALUES ('1', 'bandaoti', null, 'MCU研究', null, null);
INSERT INTO `sa_bankuai_article` VALUES ('2', 'bandaoti', null, '集成电路（IC）基本知识', '<p><span style=\"color: #e67e23;\">集成电路</span>（Integrated Circuit，IC）是指组成电路的有源器件、无源元件及其互连一起制作在半导体衬底上或绝缘基片上，形成结构上紧密联系的、内部相关的电子电路。集成电路被广泛应用于通信、安防、军事、工业、交通、消费电子（例如：手机、电视、电脑等）等领域。</p>\n<p><span style=\"color: #e67e23;\">芯片</span>一般是肉眼能够看到的长满了很多小脚的或者脚看不到，但是很明显的方形的那块东西。<span style=\"color: #e67e23;\">芯片是内含集成电路的硅片</span>，体积很小，常常是计算机或其他电子设备的一部分，<span style=\"color: #e67e23;\">是集成电路的载体</span>，由晶圆分割而成。</p>\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/png;base64,\" /></p>\n<p>用身边实物来举例的话<span style=\"color: #e67e23;\">半导体材料</span>可以比作制作纸张的纤维，<span style=\"color: #e67e23;\">集成电路</span>可以比作纸张，<span style=\"color: #e67e23;\">芯片</span>可以比作纸张做成的书本。工程师们努力的方向就是让集成电路更小更复杂，使得芯片的功能更强大。</p>\n<p><span style=\"color: #e67e23;\">die</span>，黑盒子里面的东西，又称裸片，是未经封装的芯片，是从晶圆（wafer）上扒拉下来的小方块。</p>\n<p><span style=\"color: #e67e23;\">晶圆</span>（芯片的母胎），一块晶圆上的一个个排列整齐的小方块就是芯片。</p>\n<p>&nbsp;</p>\n<p style=\"text-align: center;\"><img src=\"data:image/png;base64,\" /><img src=\"data:image/png;base64,\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>集成电路制造过程十分复杂，主要包括硅片制造、集成电路设计、前道工艺和后道工艺四大环节共计数百道工艺。</p>\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/png;base64,\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', null);

