INSERT INTO `sa_stockdetail` VALUES ('13', 'sh600893', '航发动力', '1', '研报跟踪12356', '<p style=\"text-align: left;\"><strong><span style=\"color: #2dc26b;\">航空发动机订单饱满，Q1收入超市场预期。公司22Q1实现营收54.00亿元，同比增长44.30%，公司营收实现快速增长。我们分析认为国内航空发动机产业加速发展的势头仍在持续，预计今年收</span>入增长将全面加速。</strong></p>\n<p><img src=\"data:image/png;base64,\" /></p>\n<p>Q1毛利率同比下滑，环比企稳。公司22Q1毛利率10.53%，较去年同期降低4.81pcts，我们分析主要原因仍是新产品占比提升，但工艺尚未成熟毛利率仍处于较低水平。本季度毛利率较21Q4的10.23%环比提高0.30pcts，结束自去年下半年以来的下滑趋势。我们判断，随着生产规模扩大，经验积累，公司毛利率有望逐步恢复增长趋势。期间费用下降叠加投资收益增加，Q1业绩实现高增长。公司归母净利润为0.66亿元，同比增长92.51%，扣非归母净利润0.35亿元，同比增加18.54%。公司利润增速高于营收和扣非利润增长，主要原因为：1）公司强化内部管理，22Q1期间费用率较上年同期减少4.57pcts至9.71%，其中公司管理费用销售占比6.50%，较上年同期降低4.35pcts；2）投资收益较去年同期增加约3600万元。</p>\n<p>关注收入增长，等待利润释放。航空发动机为我国重要的战略产业，近年来虽有较大突破，设计及制造水平仍处于追赶国际先进的阶段。受到产业发展客观现状的影响，并由于公司大量新产品的生产工艺经验还需积累，导致毛利率不可避免地阶段性下滑。随着公司订单放量导致的收入增长，以及公司产品技术逐步成熟，规模效应显现，公司毛利率也有望企稳反弹，并形成持续提升趋势。</p>\n<p>&nbsp;</p>\n<p><em><strong>维持盈利<span style=\"color: #843fa1;\">预测及&ldquo;买入&rdquo;评级。我们维持公司2022-24年归母净利润预测为14.9/18.6/23.2亿元，当前股价对应PE分别为70/56/45倍。考虑到军用飞机列装加速，发动机国产化率迅速提高，以及公司的行业垄断地位，因此维持&ldquo;买入&rdquo;评级</span>。</strong></em></p>\n<p><em><strong>风险提示：军费支出不及预期；重点产品研制或交付不及预期；产能建设不及预期</strong></em><br /><br /></p>\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"1\">\n<tbody>\n<tr>\n<td style=\"width: 18.5893%;\">1</td>\n<td style=\"width: 18.5893%;\">3</td>\n<td style=\"width: 18.5893%;\">2</td>\n<td style=\"width: 18.5893%;\">2</td>\n<td style=\"width: 18.5904%;\">2</td>\n</tr>\n<tr>\n<td style=\"width: 18.5893%;\">2</td>\n<td style=\"width: 18.5893%;\">2</td>\n<td style=\"width: 18.5893%;\">3</td>\n<td style=\"width: 18.5893%;\">2</td>\n<td style=\"width: 18.5904%;\">2</td>\n</tr>\n</tbody>\n</table>');
