INSERT INTO `sa_stockdetail` VALUES ('15', 'SH600096', '云天化', '1', '磷矿石行业分析框架', '<p><b>1）磷矿石属于不可再生资源，其具有稀缺性，用途广泛。含磷矿物是全球重要的非金属矿物资源之一。磷矿石是磷化工的起点，其具有不可再生性、不可循环利用性等特点，属一次</b></p><p><b>性矿产资源。磷化工产品主要为磷肥、磷酸、磷酸盐、农药等，被广泛应用于农业、食品、阻燃剂、洗涤剂、电子等行业，重要性凸显。</b></p><p>2）全球磷矿石供给及贸易格局：全球磷矿资源分布严重不均衡，中国以4.5%的磷矿石储量贡献着全球磷矿石40.2%的产量。据USGS 2021年预测数据，从储量上看，全球磷矿石储量</p><p>共710亿吨，其中摩洛哥和西撒哈拉储量最大，达到500亿吨，占比超过70%；中国储量为32亿吨，占比为4.51%，较摩洛哥和西撒哈拉规模差距较大。从产量上看，2021年全球每年</p><p>开采磷矿约2.2亿吨，中国、摩洛哥、美国、俄罗斯均为磷矿石主要供给国。其中，我国是世界最大的磷矿石生产国，贡献了全球磷矿产量的约40.2%（2020年中国磷矿石产量8800万</p><p>吨）。即：中国以4.5%的磷矿石储量贡献着全球磷矿石40.2%的产量，且储采比仅为36（远低于世界平均值324），开采过度问题突出。从全球贸易角度看，在2020年全世界生产的大</p><p>约2.2亿吨磷矿石中，只有大约3000万吨（13.6%）在国际上交易。根据CRU的数据，摩洛哥OCP是最大的磷矿石出口商，2020年市场份额占全球出口量的31.9%，其次是约旦、秘鲁、</p><p>埃及、俄罗斯，各自的市场份额分别为17%、12.6%、10%、8.7%，中国在国际磷矿石出口市场中所占份额为1.1%。</p><p>3）我国磷矿石供给端：2017-2020年中国磷矿石产量延续下降趋势，未来供给扩张增量有限且有望持续收紧。矿产资源安全事关国家发展，磷矿资源保护逐渐受到重视，从2005年起，</p><p>国内逐渐开始出台政策以提高磷矿开采行业准入门槛、控制磷矿开采量、限制磷矿石出口。同时，安全、环保政策趋严对磷矿石减产的影响不可忽视：2016年，我国磷矿石产量达到峰</p><p>值后，2017-2020年期间，我国磷矿石产量已连续五年下降。目前，我国前十大磷矿石生产企业贡献近一半的磷矿石产量。我国现有磷矿石大型企业包括贵州磷化集团、云天化、兴发</p><p>集团、川恒股份、川发龙蟒、新洋丰、司尔特、湖北宜化等，2021年磷矿产能分别达到1700、1450、415、250、115、90、80、30万吨，合计约4130万吨。未来磷矿石在行业准入门</p><p>槛提高、环保高压的背景下，其供给端有望持续趋紧；在磷矿石成本面支撑下，磷化工产业链产品价格也将偏强运行。</p><p><b>4）我国磷矿石供需格局：磷酸铁需求高速增长，我国磷矿石供应将中长期延续偏紧态势。磷矿石的传统下游需求主要为湿法磷酸（一体化装置下游主要为磷肥）、黄磷以及磷矿粉肥/</b></p><p><b>普钙/钙镁/脱氟磷酸钙/硝酸磷肥等。我们假设磷矿石边际产量有所增加、磷肥行业持续减量增效，黄磷行业将持续淘汰落后产能。未来，随着新能源汽车需求与渗透率、磷酸铁锂电池</b></p><p><b>需求与渗透率快速增长，上游磷酸铁前驱体需求量将呈现出高速增长的态势。我们预计2022-2025年我国磷酸铁需求量将分别达到65.6、108.1、169.8、240.3万吨，折合磷矿石消耗量</b></p><p><b>184、303、476、673万吨；我国磷矿供应缺口（产量-表观需求-出口）将分别为230、133、19、-25万吨。中长期来看，我国磷矿石供应将延续偏紧态势。</b></p><p>投资建议：我国磷化工产业的发展处于转型期，近1-2年来，我国以磷矿石为起点的磷化工行业景气度已发生了较大变化。从上游来看，未来磷矿石在行业准入门槛提高、环保高压的</p><p>背景下，其供给端有望持续趋紧，资源品稀缺属性凸显；中间产物黄磷由于其高能耗、高污染的特点，行业受到了更严格的监管，产能过剩问题得到缓解；从下游来看，世界各国更加</p><p>重视粮食安全问题，农业种植面积增加，磷化工下游化肥需求刚性。此外，磷酸铁锂电池需求激增提升了“湿法磷酸-磷酸铁”产业景气度。2021年年初迄今，磷化工行业全产业链持</p><p>续共振。未来，全球及我国农化产品需求仍将支撑我国磷化工需求的“基本盘”，磷酸铁等精细磷化工产品将助力于推进我国磷化工行业转型升级并提高产业价值水平。建议关注：云</p><p>天化、兴发集团、云图控股、湖北宜化、川发龙蟒、川金诺、新洋丰等公司。</p><p><br></p><p><img src=\"data:image/png;base64,\" alt=\"\"></p><p><br></p><p>（1）磷灰石。磷灰石矿一般是由熔融的岩浆冷却结晶而行成的，属于分布在火成岩中的矿物。它具有</p><p>六角形的晶体结构，不含结晶水。纯粹的磷灰石中约含有42%的五氧化二磷。磷矿的颜色由于所含的杂</p><p>质不同和共生的矿物不同，而有灰白色、灰绿色、灰黑色等。</p><p>（2）磷块岩。磷块岩(纤核磷灰石)是由几百万年前海洋、湖泊中许多含磷物的极小颗粒在海底或湖底</p><p>沉积而成的沉积岩，也可以说分散状态的磷灰石是形成磷块岩的原始物质。磷块岩一般为细小的结晶</p><p>体或呈隐晶质状态(隐晶质就是矿物晶体细小，肉眼无法分辨而只能在显微镜下看出的矿物颗粒)，颜</p><p>色有灰白色、浅绿色、黄褐色、灰黑色等。磷块岩的主要成分虽然也是氟磷酸钙，但常含有若干杂质</p><p>，除碳酸盐外，还有硅石（石英）、海绿石、高岭土及少量铁矿石或长石以及有机物等，这些杂质降</p><p>低了产品有效磷的含量。磷块岩因矿床的性质不同，又可以分为层状的和结核状或卵石状的也有层状</p><p>和结核状同时存在的，层状的磷块岩是片状的氟磷酸钙与碳酸钙或硅酸盐共生的磷矿。我国贵州的开</p><p>阳、福泉、瓮福磷矿，云南的昆阳磷矿，越南、摩洛哥及美国佛罗里达的磷矿都属于这一类。这一类</p><p>磷块岩的特点是含五氧化二磷较高，铁、铝杂质一般比较低。是生产过磷酸钙比较好的原料。</p>');
