INSERT INTO `sa_stockdetail` VALUES ('18', 'SZ300124', '汇川技术', '1', '汇川技术公司简介', '<p>2021 业务占比分别为：通用自动化：50%；电梯电气大配套：28%；新能源汽车：17%；工业机器人：2%；轨道交通：3%。</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>');
INSERT INTO `sa_stockdetail` VALUES ('19', 'SZ300327', '中颖电子', '1', '公司基本业务概览', '<p><span class=\"mce-nbsp-wrap\" contenteditable=\"false\">&nbsp;&nbsp;&nbsp;</span><span class=\"mce-nbsp-wrap\" contenteditable=\"false\">&nbsp;&nbsp;&nbsp;</span>中颖主要产品为工业控制级别的微控制器芯片和OLED 显示驱动芯片：公司微控制器系统主控单芯片主要用于<span style=\"color: #e03e2d;\">家电主控</span>、<span style=\"color: #e03e2d;\">锂电池管理、电机控制</span>、<span style=\"color: #e03e2d;\">智能电表</span>及<span style=\"color: #e03e2d;\">物联网</span>领域。OLED 显示驱动芯片主要用于<span style=\"color: #e03e2d;\">手机和可穿戴产品的屏幕</span>显示驱动。</p>\n<p>&nbsp; &nbsp; &nbsp; 全球 MCU 市场稳健成长，根据咨询机构 IC Insights 的数据，预计 2023 年整体规模将达 188 亿美元。聚焦到中国市场，据 IHS 数据统计，近五年中国 MCU 市场年平均复合增长率(CAGR)为 7.2%，是同期全球 MCU 市场增长率的 4 倍，2019 年中国 MCU市场规模达到 256 亿元。&nbsp;</p>\n<p>&nbsp; &nbsp; &nbsp;&nbsp;</p>');
